Un vero Montanaro rimane tale, sia in montagna
{pageend:che in pianura!}
Ghiahahah! Forza, sono pronto!!!

{pageend:!}
Ti svelerò un trucco... Quando vedi questo
segnale, dai uno strattone alla canna da pesca!

{pageend:Eccoti, finalmente!}
